const canvas = document.querySelector('canvas');

const ctx = canvas.getContext('2d');

canvas.height = window.innerHeight;
canvas.width = window.innerWidth;



/*
*
* For Collision Detection Between Mouse And Particle
*
*/
let mouse = {
    x:null,
    y:null,
    radius:100
}




addEventListener('mousemove', event =>{
    mouse.x = event.x ;
    
    mouse.y = event.y;
    
});


/*
*
* Draw Image
*
*/

function drawImage(){
    let imageWidth = png.width;
    let imageHeight = png.height;
    
    //Method for draw image
    const data = ctx.getImageData(0, 0, imageWidth, imageHeight);
    ctx.clearRect(0,0, canvas.width, canvas.height);



    //Class for Particle
    class Particle {
        constructor(x, y, color, size){
            this.x = x + canvas.width/2 - png.width * 2;
            this.y = y + canvas.height/2 - png.height * 2;
            this.color = color;
            this.size = 2;
            this.baseX = x + canvas.width/2 - png.width * 2;
            this.baseY = y + canvas.height/2 - png.height * 2;
            this.density = (Math.random() * 10) + 2; //2 to 12
        }

        draw(){
            ctx.beginPath();
            ctx.arc(this.x, this.y, this.size, 0, Math.PI*2, false);
            ctx.closePath();
            ctx.fill();
        }

        update(){
            ctx.fillStyle = this.color;
            let distX = mouse.x - this.x;
            let distY = mouse.y - this.y;
            let distance = Math.sqrt(distX * distX +  distY * distY );
            let forceDirectionX = distX / distance;
            let forceDirectionY = distY / distance;


            //This is max distance for particle pushed from mouse. If the value pass max distance, the force will be 0. 
            const maxDistance = 200;
            let force = (maxDistance - distance) / maxDistance;
            if(force < 0) force = 0;


            //Direction of particle pushed from mouse 
            let directionX = (forceDirectionX * force * this.density * 2);
            let directionY = (forceDirectionY * force * this.density * 2);


            //Collision Detection between Mouse and Particle
            if(distance < mouse.radius + this.size){
                
                this.x -= directionX;
                this.y -= directionY;
            }else{
                if(this.x !== this.baseX){
                    let dx = this.x - this.baseX;
                    this.x -= dx/20;
                }

                if(this.x !== this.baseY){
                    let dy = this.y - this.baseY;
                    this.y -= dy/20;
                }

            }

            this.draw();       
         }
    }

    function init(){
        particleArray = [];

        //So the image will be calculate, y = 0, loop x = 0, 1, 2, 3,....y = 1, loop x = 0, 1, 2, 3,... or column 0(y) loop row 0(x), row 1(x),and so on. With this loop the image will be made.
        for (let y = 0, y2 = data.height; y < y2; y++) {
            for (let x = 0, x2 = data.width; x < x2; x++) {
                if(data.data[( y * 4 * data.width)  + (x * 4) + 3] > 128){
                    
                    let positionX = x;
                    let positionY = y;
                    
                    //rgb(red, green, blue)
                    let color = `rgb(${data.data[( y * 4 * data.width)  + (x * 4)] }, 
                                      ${data.data[( y * 4 * data.width)  + (x * 4) + 1]},
                                      ${data.data[( y * 4 * data.width)  + (x * 4) + 2]})`


                                     
                    particleArray.push(new Particle(positionX * 4, positionY * 4, color));
                }
                
            }
        }
    }


    //For render
    function animate(){
        requestAnimationFrame(animate);
        ctx.fillStyle = 'rgba(255, 255, 255, .2)';
        ctx.fillRect(0, 0, innerWidth, innerHeight);


        for (let i = 0; i < particleArray.length; i++) {
                particleArray[i].update();
            
        }
    }

    init();
    animate();

    window.addEventListener('resize', () =>{
        canvas.width = innerWidth;
        canvas.height = innerHeight;

        init();
    });
}

//Image
let png = new Image();

//base64 code for the image that already convert to base64 
png.src = "data:image/png;base64,";






/*
*
* So When The Page Is Loaded, The Method Will Run
*
*/
window.addEventListener('load', () =>{
    console.log('page has loaded');

    //this is part of canvas API method to draw image on canvas
    ctx.drawImage(png, 0, 0);

    //this is method that we make in above
    drawImage();
});